window.bookSummaryJSON = "<p>Nowhere is safe: online or off. </p> <p>The ZERO virus continues its spread across the globe. For Clay Hopewell and his friends, this spells more danger than ever before. </p> <p>Digitally reincarnated into the world's most powerful online video game, Clay must now find out what's happening on the outside to save those living in his world. On top of this, he's been pushed into a quest by a young paranoid king, nations are preparing for war, and a malevolent glitch continues its path of destruction. </p> <p>Even with the help of his sword-slinging girlfriend and thieving best bud, dark forces swirl in the background, hoping to transform the fantasy world they now call home into a digital hell. </p> <p>Your next quest starts now.</p>"; 
